import * as React from 'react';
import Box from '@mui/material/Box';
import Button from '@mui/material/Button';
import TextField from '@mui/material/TextField';

export default function MedicationInput() {
    const inputHeight = {
      height: "10ch"
    };

    return (
        <Box
            component="form"
            sx={{
                '& .MuiTextField-root': {mb: 2, mt: 2, width: '50ch'},
            }}
            noValidate
            autoComplete="on"
        >
            <div>
                <TextField
                    required
                    id="outlined-search"
                    label="Medication"
                    type="search"
                    helperText="Input your medication's name"
                    sx={inputHeight}
                />
                <br />
                <TextField
                    required
                    id="outlined-number"
                    label="Dose"
                    type="number"
                    helperText="Input your medication's dosage in mg"
                    sx={inputHeight}
                />
            </div>

            <Button variant="contained" size="large" sx={{height: "10ch", width: '50ch'}}> Submit</Button>
        </Box>
    );
}
